Here's some fancam audience view footage of Janet Jackson performing "Got 'Til It's Gone", when special guest Q-Tip came out to spit his rap during the song live at the 2018 Global Citizen Festival in Central Park, New York. This is the first time that they've performed this track together in 20 years.

Visit http://www.ConcertDaily.com for all of your concert needs, including pics, videos, reviews and much more!

